  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Innoko
  NWR outlines Refuge accomplishments during the 1987 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. The report includes
  a planning section which discusses the master plan, management planning, compliance
  with environmental and cultural resource mandates, and research and investigations.
  Refuge administration is outlined; information about personnel, youth programs,
  volunteer programs, funding, and safety is given. Habitat management is also covered;
  subjects include wetlands, forests, and fire management. The wildlife section of
  the report discusses wildlife diversity, waterfowl, raptors, game mammals, fisheries
  resources, and marking and bird banding. The public uses of the Refuge described
  in this report include outdoor classrooms, hunting, fishing, trapping, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, communication systems, and computer systems. Cooperative programs
  are provided at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
